	color = clamp (openfl_ColorOffsetv + (color * colorMultiplier), 0.0, 1.0);

	if (color.a > 0.0) {

		gl_FragColor = vec4 (color.rgb * color.a * openfl_Alphav, color.a * openfl_Alphav);

	} else {

		gl_FragColor = vec4 (0.0, 0.0, 0.0, 0.0);

	}

} else {

	gl_FragColor = color * openfl_Alphav;

}"

